import React, { Component } from 'react';


class LanguageBar extends Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="languageBar">
                <div className="favCount">{this.props.favCount}</div>
                <div className="language">{this.props.language}</div>
                <div className="upVote">
                    <button className="upVoteButton">vote!</button>
                </div>
            </div>
        )
    }
}


export default LanguageBar;
